const DefectReport = createSlice({
  name: 'defect',
  initialState,
  reducers: {
    setList(init, action) {
      const state = init
    },
    pushToList(init, action) {
      const state = init
      state.list?.push(action.payload)
    },
    updateList(init, action) {
      const state = init
      console.log(action?.payload, "action?.payload")
      const index = state.list?.findIndex(item => item?.JobID === action?.payload?.JobID);
      console.log(index, "index")
      state.list?.splice(index, 1, action?.payload);
    },
    setDefectEditDetail(init, action) {
      const state = init
      state.defectEditDetail = action.payload
    },
    setDetail(init, action) {
      const state = init
      state.detail = action.payload
    },
    setSavePhoto(init, action) {
      const state = init
      state.savePhoto = action.payload
    }
  }
})

export const { setList, pushToList, setDefectEditDetail, setSavePhoto, setDetail, updateList } = DefectReport.actions

export default DefectReport.reducer